import React from 'react';

import CheckboxStyle from "./CheckboxStyle"

const Checkbox = props => {
    return (
      <CheckboxStyle>
        <label style={{
            width: "100%",
            display: "block",
            position: "relative"
        }}>
          {props.title} &nbsp;
          <input
            type="checkbox"
            id={"chbx" + props.key}
            checked={props.checked}
            onChange={props.onPress}
          />
        </label>
      </CheckboxStyle>
    );
  };


export default Checkbox;
